<!-- *@File name: new_0120
	 *@Brief: 藉由讀檔顯示其資料的折線圖。
	 
	 *讀檔(有01)來判斷是否為Epitope的，並標準化各模式，和各模式標準化後的分數相加和相乘再標準化，以及計算序列的結構擁擠度性質。
	 *更改Window Size或性質，立即觸發線圖更新，但Size不得是偶數且不得大於31或是負數。
	 *新增WCN2，藉由第二個讀檔來完成，參考其他鏈的影響。
	 *小幅度修改讀取WCN的讀檔邏輯。
	 *將WCN2曲線增加到第二個折線圖(四種性質的)和第三個折線圖(加和乘的)，並將WCN2線段改為黑灰色。
	 *除錯:第二個讀檔內容chain幾乎是按照字母順序排列，造成計算WCN2時，總是抓取第一個抓到的chain去做計算，已將檔案內容地一個擺放的chain為WCN2所要的。
	 *新增各性值的四分位圖。
	 *將計算四分位圖的計算程式化。
	 *在第四個折線圖增加表位/非表位WCN2-WCN1平均線。
	 *刪去第一個折線圖。
	 *更正WCN2的四分位圖。
	 *在第二個折線圖(加乘)增加各性值和平均值的差的平均線。
	 *秀出109張蛋白質走向趨勢圖。(但未顯示出來，因為太LAG，請參閱AllProtein.htm)
	 *在第三個折線圖增加zcs(保留度)性值。
	 *小幅度修改顯示資訊，並讓全部的圖表Y軸顯示範圍一致(正負四)。
	 *修改圖表專有名詞顯示。
	 *新增序列特異性保留分數的四分位圖。
	 *新增check box
	 *@Author: 黃道湧，蔡采潔。
	 *@Update: 2016/01/20
-->

	/*@Brief: 第一個讀檔按鈕按下時執行。*/
	function readSeqFile() 
	{                                                      
		file = this.files[0];
		var fReader = new FileReader();
		fReader.onload = trigger_1;
		fReader.readAsText(file);
	}
	function trigger_1(event) 											//	event為[object ProgressEvent]
	{ 	
		var txtFileNameLength = file.name.length - 4;					//	需扣掉.txt四個字元數
		var fileResult = event.target.result;							//	檔案的所有內容
		var fileContentLength = event.target.result.length;				//	檔案內容的字元數
		chainLetter_Global = file.name.substring(5, 6);
		fileSeqName = file.name.substring(0, 6);
		
		/*@Debug: 檢查截取的內容是否為蛋白質序列，該內容會顯示在在第一框架。*/
		document.getElementById('sequenceFileContent').value = fileResult.substring
		(txtFileNameLength + 3, ((fileContentLength - (txtFileNameLength + 3)) / 2) + (txtFileNameLength + 3));
		//document.getElementById('sequenceFileContent').value = chainLetter;
			
		var sequence = [];												//	存放蛋白質序列
		sequence = fileResult.substring(txtFileNameLength + 3, ((fileContentLength - (txtFileNameLength + 3)) / 2) + (txtFileNameLength + 3));
		sequence_Global = sequence;
		epitopeMark_Global = fileResult.substring((fileContentLength - ((fileContentLength - (txtFileNameLength + 3)) / 2)) + 1, fileContentLength); 
		
		purposeOfReuse();
		

	}

	/*@Brief: 計算Sliding Window，Default Size設定為13。
	 *@param_in: 要計算的分數。
	 *@param_out: 計算過後的分數。*/
	function slidingWindow(score)
	{
		var i = 0;														//	迴圈第一層所使用的索引
		var j = 0;														//	迴圈第二層所使用的索引
		var k = 1;														//	迴圈內的位移量所使用
		var windowScore = [];
		var sum = [];
		
		for(i = 0; i < seqLeng_Global; i ++)                                                    
		{
			  windowScore[i] = 0;										//	必須初始化後才能使用
			  sum[i] = 0;
		}
		for(i = 0; i < (windowSize_Global - 1) / 2; i ++)                                          //i=(0~5)
		   for(j = 0; j < ( i + ((windowSize_Global - 1) / 2) + 1); j ++)                //j=(0~i+6)
		       sum[i] = sum[i]/1 + score[j]/1;                                                         //sum[0]=sum[0]+score[0~6]
		for(i = seqLeng_Global - 1; i > (seqLeng_Global - ((windowSize_Global - 1) / 2) - 1) ; i --)            //i=(129~124)
		{
		   for(j = seqLeng_Global - 1; j > (seqLeng_Global - ((windowSize_Global - 1) / 2) - k - 1); j --)          //j=(129~124-k)
		   {
		       sum[i] = sum[i]/1 + score[j]/1;                                                       //sum[129]=sum[129]+score[129~123]
		   }
		   k++;
		}
    	for(i = (windowSize_Global - 1) / 2; i < (seqLeng_Global - ((windowSize_Global - 1) / 2)); i ++)                                                //因為windowsize=13  前6個(0~5)最終值將為0  所以迴圈初值從6開始計算
    		for(j = (i - ((windowSize_Global - 1) / 2)); j < (i + ((windowSize_Global - 1) / 2) + 1); j ++)                                          //總和範圍為  x-6到x  x到x+6
    			sum[i] = sum[i]/1 + score[j]/1;
    
    	for(i = (windowSize_Global - 1) / 2; i <(seqLeng_Global - ((windowSize_Global - 1) / 2)); i ++)                                                   //取平均給變數final_score  當作最終分數
    	{
    		windowScore[i] = (sum[i] / windowSize_Global);
			windowScore[i] = windowScore[i].toFixed(3);
    	}
		for(i = 0; i < ((windowSize_Global - 1) / 2);i ++)
		{
		    windowScore[i] = (sum[i] / (((windowSize_Global - 1) / 2) + i + 1)); 
            windowScore[i] = windowScore[i].toFixed(3);			
		}
		k = 1;
		for(i = seqLeng_Global -1 ; i > (seqLeng_Global - ((windowSize_Global - 1) / 2) -1 ); i --)
		{
		    windowScore[i] = (sum[i] / (((windowSize_Global - 1) / 2) + k));
			windowScore[i] = windowScore[i].toFixed(3);
			k++;
		}
		return windowScore;
	}	
/*---[End Area4-1]---*/

	/*@Brief: 標準化。
	 *@param_in: 取Window過後的分數。
	 *@param_out: 標準化過後的分數。*/
	function standardizing(windowScore)
	{
	   var average_real_score = 0;                 //平均
	   var average_square_score = 0;              //平方的平均
	   var square_average_score = 0;              // 平均的平方
	   var square_score  = [];                    //平方
	   var sigma = 0; //標準差 = 「平方的平均」減去「平均的平方」
	   var i = 0;													//	迴圈第一層所使用的索引
	   var z_score = [];
	   var singlePoint = [];
	   
	   for(i = 0; i < seqLeng_Global; i ++)
	 
	      square_score[i] = windowScore[i] * windowScore[i];
	
	   for(i = 0;i < seqLeng_Global;i ++)
	   {
	      average_square_score = (average_square_score + square_score[i]/1);         ///平方的總合
       }
	   average_square_score = average_square_score /(seqLeng_Global);
	   
	   for(i = 0;i <seqLeng_Global;i ++)
	   {
	      average_real_score = (average_real_score + (windowScore[i]/1));
	   }
	   average_real_score = average_real_score / (seqLeng_Global);
	   
	   square_average_score = average_real_score*average_real_score;                 //平均的平方
	   sigma = Math.sqrt(average_square_score - square_average_score);
	  
	   for(i =0;i <seqLeng_Global;i ++)
	   {
	      z_score[i] = ((windowScore[i]/1)-average_real_score)/sigma;
		  z_score[i] = z_score[i].toFixed(3);
	   }
	   for(i =0;i <seqLeng_Global;i ++)
	   {
	     singlePoint[i] = z_score[i];
	   }
	   return singlePoint;
	}
/*---[End Area4-2]---*/
/*---【Area4-3】---*/
	/*@Brief: 計算WCN結構擁擠度性質。
	 *@param_in: X點，Y點，Z點。
	 *@param_out: 計算完擁擠度性質的總合分數。*/
	function wcn(xPoint, yPoint, zPoint, chainLength)
	{
		//var xDiff = [];													//	存放Xi-Xj的2-D Array
		//var yDiff = [];													//	存放Yi-Yj的2-D Array
		//var zDiff = [];													//	存放Zi-Zj的2-D Array
		var xSquare = [];												//	存放(Xi-Xj)^2的2-D Array
		var ySquare = []; 												//	存放(Yi-Yj)^2的2-D Array
		var zSquare = [];												//	存放(Zi-Zj)^2的2-D Array
		//var sum = [];
		var invert = [];
		var sigma = [];
		/*@Brief: 計算相差 xDiff = Xi-Xj, yDiff = Yi-Yj, zDiff = Zi-Zj。*/
		/*for (i = 0; i < chainLength; i ++)
		{
			xDiff[i] = [];												//	讓xDiff變二維陣列
			yDiff[i] = [];												//	讓yDiff變二維陣列
			zDiff[i] = [];												//	讓zDiff變二維陣列
			for (j = 0; j < chainLength; j ++)
			{
				if (j != i)
				{
					xDiff[i][j] = xPoint[i] - xPoint[j];			
					yDiff[i][j] = yPoint[i] - yPoint[j];
					zDiff[i][j] = zPoint[i] - zPoint[j];
				}
				else if (j == i)
				{
				   xDiff[i][j] = 0;
				   yDiff[i][j] = 0;
				   zDiff[i][j] = 0;
				}
			}
		}*/
		/*@Brief: 計算平方 xSquare = (Xi-Xj)^2, ySquare = (Yi-Yj)^2, zSquare = (Zi-Zj)^2。*/
		for (i = 0; i < chainLength; i ++)
		{
			xSquare[i] = [];
			ySquare[i] = [];
			zSquare[i] = [];
			for (j = 0; j < chainLength; j ++)
			{
				if (j != i)
				{
					xSquare[i][j] = (xPoint[i] - xPoint[j]) * (xPoint[i] - xPoint[j]);
					ySquare[i][j] = (yPoint[i] - yPoint[j]) * (yPoint[i] - yPoint[j]);
					zSquare[i][j] = (zPoint[i] - zPoint[j]) * (zPoint[i] - zPoint[j]);
				}
				else if (j == i)
				{
					xSquare[i][j] = 0;
					ySquare[i][j] = 0;
					zSquare[i][j] = 0;
				}
			}
		}
		/*@Brief: 計算總和 sum = (Xi-Xj)^2 + (Yi-Yj)^2 + (Zi-Zj)^2。*/
		/*for (i = 0; i < chainLength; i ++)
		{
			sum[i] = [];
			for (j = 0; j < chainLength; j ++)
				sum[i][j] = xSquare[i][j] + ySquare[i][j] + zSquare[i][j];
		}*/
		/*@Brief: 計算倒數 invert = 1/(((Xi-Xj)^2 + (Yi-Yj)^2 + (Zi-Zj)^2)^(1/2))。*/
		for (i = 0; i < chainLength; i ++)
		{
			invert[i] = [];
			for (j = 0; j < chainLength; j ++)
			{
				if (i != j)
					invert[i][j] = 1 / (xSquare[i][j] + ySquare[i][j] + zSquare[i][j]);
				else
					invert[i][j] = 0;
			}
		}
		/*@Brief: 計算倒數 invert = 1/(Xi-Xj)^2 + (Yi-Yj)^2 + (Zi-Zj)^2)。*/
		for(i = 0; i < chainLength ; i ++)
			sigma[i] = 0;												//	sigma必須先初始化後才能使用
		for (i = 0; i < chainLength; i ++)
		{
			for (j = 0; j < chainLength; j++)
			{	
				sigma[i] = sigma[i] + invert[i][j];
				//sigma[i] = sigma[i].toFixed(5);
			}
		}
		return sigma;
	}
/*---[End Area4-3]---*/

	function calculateQ(percent, length, data)
		{	
			var re = /^[0-9]*[1-9][0-9]*$/;					//	正整數正規表示法
			var QboxImage = [];
			//QboxImage = data;
			
			var Q = length * percent;
			if (!re.test(Q))
				QboxImage = [(Math.ceil(Q)/length).toFixed(2), data[Math.ceil(Q)].toFixed(2)];
				//return data[Math.ceil(Q1)];
			else
				QboxImage = [(Q/length).toFixed(2), ((data[Q] + data[Q+1]) / 2).toFixed(2)];
			return QboxImage;
		}

			else if (sequence[i] == 'L')	returnScore[i] = 1.25;
			else if (sequence[i] == 'M')	returnScore[i] = 0.826;
			else if (sequence[i] == 'N')	returnScore[i] = 0.776;
			else if (sequence[i] == 'P')	returnScore[i] = 1.064;
			else if (sequence[i] == 'Q')	returnScore[i] = 1.015;
			else if (sequence[i] == 'R')	returnScore[i] = 0.873;	
			else if (sequence[i] == 'S')	returnScore[i] = 1.012;	
			else if (sequence[i] == 'T')	returnScore[i] = 0.909;	
			else if (sequence[i] == 'V')	returnScore[i] = 1.383;	
			else if (sequence[i] == 'W')	returnScore[i] = 0.893;	
			else if (sequence[i] == 'Y')	returnScore[i] = 1.161;
			else							returnScore[i] = 0.000;
			i++;
		} 
		return returnScore;
	}	
/*---[End Area5-3]---*/
/*---【Area5-4】---*/
	/*@Brief: 根據Hydrophilicity性質所建立的表格。
	 *@param_in: 胺基酸序列。
	 *@param_out: 各個胺基酸所代表的分數。*/
    function hydrTable(sequence) 
	{
		var i = 0;															//	迴圈第一層使用的索引
		var returnScore = [];												//	根據查表所得到的，需要回傳的分數
		while (i < sequence.length - 1)
		{	
			if (sequence[i] == 'A')			returnScore[i] = 2.1;
			else if (sequence[i] == 'C')	returnScore[i] = 1.4;
			else if (sequence[i] == 'D')	returnScore[i] = 10.0;
			else if (sequence[i] == 'E') 	returnScore[i] = 7.8;
			else if (sequence[i] == 'F')	returnScore[i] = -9.2;
			else if (sequence[i] == 'G')	returnScore[i] = 5.7;
			else if (sequence[i] == 'H')	returnScore[i] = 2.1;
			else if (sequence[i] == 'I')	returnScore[i] = -8.0;
			else if (sequence[i] == 'K')	returnScore[i] = 5.7;
			else if (sequence[i] == 'L')	returnScore[i] = -9.2;
			else if (sequence[i] == 'M')	returnScore[i] = -4.2;
			else if (sequence[i] == 'N')	returnScore[i] = 7.0;
			else if (sequence[i] == 'P')	returnScore[i] = 2.1;
			else if (sequence[i] == 'Q')	returnScore[i] = 6.0;
			else if (sequence[i] == 'R')	returnScore[i] = 4.2;	
			else if (sequence[i] == 'S')	returnScore[i] = 6.5;	
			else if (sequence[i] == 'T')	returnScore[i] = 5.2;	
			else if (sequence[i] == 'V')	returnScore[i] = -3.7;	
			else if (sequence[i] == 'W')	returnScore[i] = -10.0;	
			else if (sequence[i] == 'Y')	returnScore[i] = -1.9;
			else							returnScore[i] = 0.0;
			i++;
		} 
		return returnScore;
	}
